      "accessType": ["REVIEW_SUBMISSIONS", "EXEMPTION_ELIGIBLE", "UPDATE", "DELETE", "CHANGE_PERMISSIONS", "READ"]
    },
    {
      "principalId": 464532,
      "accessType": ["REVIEW_SUBMISSIONS", "EXEMPTION_ELIGIBLE"]
    }
  ]
}
```

