  "hasAccessRequirements": true,
  "aclSummary": [
    {
      "requirementId": "9605159",
      "aclId": "9605159",
      "managedBy": "Principal ID 3437288 (full management) and Principal ID 464532 (review permissions)",
      "permissions": {
        "3437288": ["REVIEW_SUBMISSIONS", "EXEMPTION_ELIGIBLE", "UPDATE", "DELETE", "CHANGE_PERMISSIONS", "READ"],
        "464532": ["REVIEW_SUBMISSIONS", "EXEMPTION_ELIGIBLE"]
      }
    }
  ],
  "dataUseSummary": "This dataset (syn51513065) is controlled by a Managed Access Requirement (ID: 9605159). Access requests are reviewed and approved by a designated Access Control Team. Principal 3437288 has full administrative control and can review data access requests, while Principal 464532 also has permissions to review access submissions. Researchers who want to use this dataset must submit a data access request through Synapse, which will be reviewed by these designated managers. To access this data, navigate to the dataset page on Synapse, click 'Request Access', and complete the required application. The access management team will review your request based on the dataset's terms of use."
}
```

